import { Card, List } from '../Card';
import { useSelector } from 'react-redux';

const Digimons = () => {

    const { digimon } = useSelector((state) => state);

    return (
        <List>
            {
               <div>
               <ul>
                 {digimon.map((digimon, index) => {
                   return <li key={index}>{digimon}</li>;
                 })}
               </ul>
             </div>

            }
        </List>
    )
}

export default Digimons;
